pe": "text", "text": "Vertices: 9,064  Faces: 18,124  Volume: 10258.60", "position": [200.0, 10.0], "height": 5.0}, {"layer": "TEXT", "color": "#0000FF", "linetype": "BYLAYER", "type": "text", "text": "Total Length", "position": [312.5, 410.0], "height": 3.5}, {"layer": "TEXT", "color": "#0000FF", "linetype": "BYLAYER", "type": "text", "text": "Head Diameter", "position": [160.0, 410.0], "height": 3.5}, {"layer": "TEXT", "color": "#0000FF", "linetype": "BYLAYER", "type": "text", "text": "Thread Length", "position": [160.0, 410.0], "height": 3.5}, {"layer": "TEXT", "color": "#0000FF", "linetype": "BYLAYER", "type": "text", "text": "Shaft Diameter", "position": [300.0, 350.0], "height": 3.5}];

  // 4) Init view
  function initView() {
    const [min, max] = extents;
    const width = Math.abs(max[0] - min[0]);
    const height = Math.abs(max[1] - min[1]);
    
    // Calculate scale to fit the drawing in the viewport
    const scaleX = (canvas.width * 0.8) / width;
    const scaleY = (canvas.height * 0.8) / height;
    scale = Math.min(scaleX, scaleY);
    
    // Center the drawing
    offsetX = canvas.width/2;
    offsetY = canvas.height/2;
    
    setupLayers();
    needsRedraw = true;
  }

  function setupLayers() {
    const lc = document.getElementById('layer-control');
    const layers = new Set(entities.map(e => e.layer));
    lc.innerHTML = '<strong>Layers</strong>';
    layers.forEach(layer => {
      layerVisibility[layer] = true;
      const div = document.createElement('div');
      div.className = 'layer-item';
      const sw = document.createElement('div');
      sw.className = 'swatch';
      sw.style.backgroundColor = entities.find(e => e.layer === layer).color;
      const cb = document.createElement('input');
      cb.type = 'checkbox';
      cb.checked = true;
      cb.onchange = () => {
        layerVisibility[layer] = cb.checked;
        needsRedraw = true;
      };
      const lbl = document.createElement('span');
      lbl.textContent = layer;
      div.append(sw, cb, lbl);
      lc.append(div);
    });
  }

  // 5) Draw
        function draw() {
    if (!needsRedraw) return;
    
            // Clear canvas
    ctx.fillStyle = '#1e1e1e';
    ctx.fillRect(0, 0, canvas.width, canvas.height);
            
            // Set up coordinate system
    const [min, max] = extents;
    const centerX = (min[0] + max[0]) / 2;
    const centerY = (min[1] + max[1]) / 2;
    
            ctx.save();
            ctx.translate(offsetX, offsetY);
    ctx.scale(scale, -scale);  // Flip Y axis
    ctx.translate(-centerX, -centerY);  // Center the drawing
            
            // Draw entities
    entities.forEach(e => {
      if (!layerVisibility[e.layer]) return;
      
      ctx.strokeStyle = e.color;
      ctx.fillStyle = e.color;
      ctx.lineWidth = 1/scale;
      ctx.setLineDash(e.linetype === 'DASHED' ? [5/scale] : []);
      
      switch(e.type) {
        case 'line':
          ctx.beginPath();
          ctx.moveTo(e.start[0], e.start[1]);
          ctx.lineTo(e.end[0], e.end[1]);
          ctx.stroke();
          break;
        case 'polyline':
                    ctx.beginPath();
          ctx.moveTo(...e.points[0]);
          e.points.slice(1).forEach(p => ctx.lineTo(...p));
          if (e.closed) ctx.closePath();
                    ctx.stroke();
          break;
        case 'circle':
                    ctx.beginPath();
          ctx.arc(e.center[0], e.center[1], e.radius, 0, 2*Math.PI);
                    ctx.stroke();
          break;
        case 'arc':
                    ctx.beginPath();
          ctx.arc(e.center[0], e.center[1], e.radius,
              e.startAngle*Math.PI/180, e.endAngle*Math.PI/180);
                    ctx.stroke();
          break;
        case 'text':
                    ctx.save();
          ctx.scale(1, -1);  // Flip text right side up
          ctx.font = `${e.height}px Arial`;
          ctx.fillText(e.text, e.position[0], -e.position[1]);
                    ctx.restore();
          break;
        case 'dimension':
                    ctx.beginPath();
          ctx.moveTo(e.defPoint[0], e.defPoint[1]);
          ctx.lineTo(e.textMidpoint[0], e.textMidpoint[1]);
                    ctx.stroke();
                    
                    ctx.save();
          ctx.scale(1, -1);
          ctx.font = `${2/scale}px Arial`;
          ctx.fillText(e.dimText, e.textMidpoint[0], -e.textMidpoint[1]);
                    ctx.restore();
          break;
                }
            });
            
            ctx.restore();
    needsRedraw = false;
  }

  // 6) Animate & pan/zoom
  function animate() {
    draw();
    requestAnimationFrame(animate);
  }

        canvas.addEventListener('mousedown', e => {
            dragging = true;
            lastX = e.clientX;
            lastY = e.clientY;
            canvas.style.cursor = 'grabbing';
        });
        
        canvas.addEventListener('mousemove', e => {
            if (dragging) {
      offsetX += e.clientX - lastX;
      offsetY += e.clientY - lastY;
                lastX = e.clientX;
                lastY = e.clientY;
      needsRedraw = true;
            }
        });
        
  ['mouseup', 'mouseleave'].forEach(evt => 
    canvas.addEventListener(evt, () => {
            dragging = false;
            canvas.style.cursor = 'grab';
    })
  );
        
        canvas.addEventListener('wheel', e => {
            e.preventDefault();
    const rect = canvas.getBoundingClientRect();
    const mx = (e.clientX - rect.left);
    const my = (e.clientY - rect.top);
    const worldX = (mx - offsetX)/scale;
    const worldY = (offsetY - my)/scale;
            const factor = e.deltaY < 0 ? 1.1 : 0.9;
            scale *= factor;
    offsetX = mx - worldX*scale;
    offsetY = my + worldY*scale;
    needsRedraw = true;
  });

  // 7) Buttons
  document.getElementById('zoom-in').onclick = () => {
            scale *= 1.2;
    needsRedraw = true;
  };
  document.getElementById('zoom-out').onclick = () => {
            scale *= 0.8;
    needsRedraw = true;
  };
  document.getElementById('fit-view').onclick = initView;
            
  // 8) Start
            initView();
  animate();
